import './Home.css';
import Welcome from '../components/Welcome'

export default function Home() {
    return (
        <>
            <img src="https://www.thegympod.com/wp-content/uploads/2021/06/DSC08227.jpg"
                    alt="hero image"
                    className="hero-image"
            />
            <Welcome />
        </>
    )
}
